CREATE DATABASE  IF NOT EXISTS `shop_nest_db` /*!40100 DEFAULT CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci */;
USE `shop_nest_db`;
DROP TABLE IF EXISTS `administrative_divisions`;
CREATE TABLE `administrative_divisions` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `country_id` bigint(20) unsigned NOT NULL,
  `parent_id` bigint(20) unsigned DEFAULT NULL,
  `name` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL CHECK (json_valid(`name`)),
  `level` int(11) NOT NULL,
  `code` varchar(255) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `administrative_divisions_country_id_foreign` (`country_id`),
  KEY `administrative_divisions_parent_id_foreign` (`parent_id`),
  CONSTRAINT `administrative_divisions_country_id_foreign` FOREIGN KEY (`country_id`) REFERENCES `countries` (`id`),
  CONSTRAINT `administrative_divisions_parent_id_foreign` FOREIGN KEY (`parent_id`) REFERENCES `administrative_divisions` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
LOCK TABLES `administrative_divisions` WRITE;
UNLOCK TABLES;
DROP TABLE IF EXISTS `analytics_reports`;
CREATE TABLE `analytics_reports` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(255) NOT NULL,
  `type` enum('revenue','orders','products','users','custom') NOT NULL,
  `period_type` enum('daily','weekly','monthly','yearly','custom') NOT NULL,
  `start_date` date NOT NULL,
  `end_date` date NOT NULL,
  `parameters` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL CHECK (json_valid(`parameters`)),
  `result_data` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL CHECK (json_valid(`result_data`)),
  `file_path` varchar(255) DEFAULT NULL,
  `status` enum('pending','completed','failed') NOT NULL DEFAULT 'pending',
  `created_by` bigint(20) unsigned NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `analytics_reports_type_created_at_index` (`type`,`created_at`),
  KEY `analytics_reports_status_created_at_index` (`status`,`created_at`),
  KEY `analytics_reports_created_by_index` (`created_by`),
  CONSTRAINT `analytics_reports_created_by_foreign` FOREIGN KEY (`created_by`) REFERENCES `users` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
LOCK TABLES `analytics_reports` WRITE;
UNLOCK TABLES;
