DROP TABLE IF EXISTS `disputes`;
CREATE TABLE `disputes` (
  `dispute_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` bigint(20) unsigned NOT NULL,
  `customer_id` bigint(20) unsigned NOT NULL,
  `seller_id` bigint(20) unsigned NOT NULL,
  `subject` varchar(200) NOT NULL,
  `description` text NOT NULL,
  `status` enum('open','under_review','resolved','closed') NOT NULL DEFAULT 'open' COMMENT 'Dispute status using ENUM values',
  `type` tinyint(4) NOT NULL COMMENT '1: Item not received, 2: Item not as described, 3: Other',
  `assigned_admin_id` bigint(20) unsigned DEFAULT NULL,
  `resolution` text DEFAULT NULL,
  `resolved_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`dispute_id`),
  KEY `disputes_order_id_foreign` (`order_id`),
  KEY `disputes_customer_id_foreign` (`customer_id`),
  KEY `disputes_seller_id_foreign` (`seller_id`),
  KEY `disputes_assigned_admin_id_foreign` (`assigned_admin_id`),
  CONSTRAINT `disputes_assigned_admin_id_foreign` FOREIGN KEY (`assigned_admin_id`) REFERENCES `users` (`id`) ON DELETE SET NULL,
  CONSTRAINT `disputes_customer_id_foreign` FOREIGN KEY (`customer_id`) REFERENCES `users` (`id`),
  CONSTRAINT `disputes_order_id_foreign` FOREIGN KEY (`order_id`) REFERENCES `orders` (`order_id`),
  CONSTRAINT `disputes_seller_id_foreign` FOREIGN KEY (`seller_id`) REFERENCES `users` (`id`)
