DROP TABLE IF EXISTS `sessions`;
CREATE TABLE `sessions` (
  `id` varchar(255) NOT NULL,
  `user_id` bigint(20) unsigned DEFAULT NULL,
  `ip_address` varchar(45) DEFAULT NULL,
  `user_agent` text DEFAULT NULL,
  `payload` longtext NOT NULL,
  `last_activity` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `sessions_user_id_index` (`user_id`),
  KEY `sessions_last_activity_index` (`last_activity`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
LOCK TABLES `sessions` WRITE;
UNLOCK TABLES;
DROP TABLE IF EXISTS `shipment_journeys`;
CREATE TABLE `shipment_journeys` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` bigint(20) unsigned NOT NULL,
  `leg_type` enum('first_mile','middle_mile','last_mile') NOT NULL,
  `shipper_id` bigint(20) unsigned DEFAULT NULL,
  `start_hub_id` bigint(20) unsigned DEFAULT NULL,
  `end_hub_id` bigint(20) unsigned DEFAULT NULL,
  `status` varchar(255) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `shipment_journeys_order_id_foreign` (`order_id`),
  KEY `shipment_journeys_shipper_id_foreign` (`shipper_id`),
  KEY `shipment_journeys_start_hub_id_foreign` (`start_hub_id`),
  KEY `shipment_journeys_end_hub_id_foreign` (`end_hub_id`),
  CONSTRAINT `shipment_journeys_end_hub_id_foreign` FOREIGN KEY (`end_hub_id`) REFERENCES `hubs` (`id`),
  CONSTRAINT `shipment_journeys_order_id_foreign` FOREIGN KEY (`order_id`) REFERENCES `orders` (`order_id`),
  CONSTRAINT `shipment_journeys_shipper_id_foreign` FOREIGN KEY (`shipper_id`) REFERENCES `users` (`id`),
  CONSTRAINT `shipment_journeys_start_hub_id_foreign` FOREIGN KEY (`start_hub_id`) REFERENCES `hubs` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
LOCK TABLES `shipment_journeys` WRITE;
UNLOCK TABLES;
DROP TABLE IF EXISTS `shipper_profiles`;
CREATE TABLE `shipper_profiles` (
  `user_id` bigint(20) unsigned NOT NULL,
  `id_card_number` varchar(255) NOT NULL,
  `id_card_front_url` varchar(255) NOT NULL,
  `id_card_back_url` varchar(255) NOT NULL,
  `driver_license_number` varchar(255) NOT NULL,
  `driver_license_front_url` varchar(255) NOT NULL,
  `vehicle_type` varchar(255) NOT NULL,
  `license_plate` varchar(255) NOT NULL,
  `status` enum('pending','approved','rejected','suspended') NOT NULL DEFAULT 'pending',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`user_id`),
  CONSTRAINT `shipper_profiles_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
LOCK TABLES `shipper_profiles` WRITE;
