DROP TABLE IF EXISTS `user_events`;
CREATE TABLE `user_events` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) unsigned DEFAULT NULL,
  `session_id` varchar(255) NOT NULL,
  `event_type` enum('page_view','product_view','add_to_cart','remove_from_cart','checkout_start','checkout_complete','purchase','login','register','logout','search','filter','wishlist_add') NOT NULL,
  `event_category` varchar(255) NOT NULL DEFAULT 'general',
  `event_data` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL CHECK (json_valid(`event_data`)),
  `ip_address` varchar(45) DEFAULT NULL,
  `user_agent` text DEFAULT NULL,
  `referrer` varchar(255) DEFAULT NULL,
  `url` varchar(255) DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `user_events_user_id_created_at_index` (`user_id`,`created_at`),
  KEY `user_events_event_type_created_at_index` (`event_type`,`created_at`),
  KEY `user_events_event_category_created_at_index` (`event_category`,`created_at`),
  KEY `user_events_session_id_index` (`session_id`),
  KEY `user_events_created_at_index` (`created_at`),
  CONSTRAINT `user_events_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
LOCK TABLES `user_events` WRITE;
UNLOCK TABLES;
DROP TABLE IF EXISTS `user_preferences`;
CREATE TABLE `user_preferences` (
  `user_preference_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) unsigned NOT NULL,
  `preferred_category_id` bigint(20) unsigned DEFAULT NULL,
  `preferred_brand_id` bigint(20) unsigned DEFAULT NULL,
  `min_price_range` decimal(18,2) DEFAULT NULL,
  `max_price_range` decimal(18,2) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`user_preference_id`),
  UNIQUE KEY `user_preferences_user_id_unique` (`user_id`),
  KEY `user_preferences_preferred_category_id_foreign` (`preferred_category_id`),
  KEY `user_preferences_preferred_brand_id_foreign` (`preferred_brand_id`),
  CONSTRAINT `user_preferences_preferred_brand_id_foreign` FOREIGN KEY (`preferred_brand_id`) REFERENCES `brands` (`brand_id`) ON DELETE SET NULL,
  CONSTRAINT `user_preferences_preferred_category_id_foreign` FOREIGN KEY (`preferred_category_id`) REFERENCES `categories` (`category_id`) ON DELETE SET NULL,
  CONSTRAINT `user_preferences_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
LOCK TABLES `user_preferences` WRITE;
