UNLOCK TABLES;
DROP TABLE IF EXISTS `wishlist_items`;
CREATE TABLE `wishlist_items` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `wishlist_id` bigint(20) unsigned NOT NULL,
  `product_id` bigint(20) unsigned NOT NULL,
  `product_variant` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL CHECK (json_valid(`product_variant`)),
  `price_when_added` decimal(10,2) DEFAULT NULL,
  `note` text DEFAULT NULL,
  `priority` int(10) unsigned NOT NULL DEFAULT 0,
  `notify_price_drop` tinyint(1) NOT NULL DEFAULT 0,
  `notify_back_in_stock` tinyint(1) NOT NULL DEFAULT 0,
  `notified_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `wishlist_items_wishlist_id_product_id_unique` (`wishlist_id`,`product_id`),
  KEY `wishlist_items_wishlist_id_priority_index` (`wishlist_id`,`priority`),
  KEY `wishlist_items_product_id_created_at_index` (`product_id`,`created_at`),
  KEY `wishlist_items_notify_price_drop_notify_back_in_stock_index` (`notify_price_drop`,`notify_back_in_stock`),
  CONSTRAINT `wishlist_items_product_id_foreign` FOREIGN KEY (`product_id`) REFERENCES `products` (`product_id`) ON DELETE CASCADE,
  CONSTRAINT `wishlist_items_wishlist_id_foreign` FOREIGN KEY (`wishlist_id`) REFERENCES `wishlists` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
LOCK TABLES `wishlist_items` WRITE;
UNLOCK TABLES;
DROP TABLE IF EXISTS `wishlists`;
CREATE TABLE `wishlists` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) unsigned NOT NULL,
  `name` varchar(100) NOT NULL DEFAULT 'My Wishlist',
  `description` text DEFAULT NULL,
  `privacy` enum('private','public','shared') NOT NULL DEFAULT 'private',
  `is_default` tinyint(1) NOT NULL DEFAULT 0,
  `items_count` int(10) unsigned NOT NULL DEFAULT 0,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `wishlists_user_id_is_default_index` (`user_id`,`is_default`),
  KEY `wishlists_privacy_created_at_index` (`privacy`,`created_at`),
  CONSTRAINT `wishlists_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
LOCK TABLES `wishlists` WRITE;
UNLOCK TABLES;